import './App.css';

const App = () => {
  return (
    <div>
      <h1>Настройка переговорной комнаты</h1>
      <h3>Перед началом работы необходимо привязать устройство</h3>

      <form action="/action_page.php" />
      <label for="fmeetingRoomAddress">Выберите адрес переговорной комнаты</label>
      <input type="text" id="fmeetingRoomAddress" name="firstname" placeholder="Your name.." />

      <label for="lname">Last Name</label>
      <input type="text" id="lname" name="lastname" placeholder="Your last name.." />

      <label for="country">Country</label>
      <select id="country" name="country">
        <option value="australia">Australia</option>
        <option value="canada">Canada</option>
        <option value="usa">USA</option>
      </select>

      <input type="submit" value="Submit" />
    </div>
  );
}

export default App;
